import react from "react";
import styled from "styled-components";
import D20 from "../../Images/Dice/D20";

const StyledD20 = styled(D20)`
  margin-top: 55px;
  height: 180px;
`;

const DiceNumber = styled.p`
  font-family: "Dosis";
  font-size: 2.8em;
  text-align: center;
`;

const DiceRoller = () => {
  state = { number: 20 };

  return (
    <div>
      <StyledD20 />
      <DiceNumber>{this.state.number}</DiceNumber>
    </div>
  );
};

export default DiceRoller;
